import React from 'react';
import {Firstname, Lastname} from './UsecontextApp';

const CompCuse = () => {
return(
    <>
    <Firstname.Consumer> 
    {(fname) => {
        return (
            <Lastname.Consumer>
                {(lname)=> { 
                    return (
                        <h1>Component C {fname} {lname} </h1>
                        ) }
                }

                </Lastname.Consumer>
            )           
    }} 
    </Firstname.Consumer>
    </>
)
}

export default CompCuse;
